var Hadean = window.Hadean || { };
if (typeof Hadean.Product == "undefined") {
    Hadean.Product = {};
}
dd = null;
if (typeof Hadean.Product.tabs == "undefined") {
  Hadean.Product.tabs = {
    newFormId : '#new_cart_item',
    addToCart : true,

    initialize      : function() {
      $('#product_tabs .section-container section ').click(function() {
        setTimeout('Hadean.Product.tabs.updateProductTabs()', 100);
      })
      $('#product_tabs .section-container .section').first().find('a').click()
      Hadean.Product.tabs.updateProductTabs();
    },
    updateProductTabs : function() {
      var heightOfTabContent = $('#product_tabs .section-container .section.active').height();
      if ( heightOfTabContent ) {
        $('#product_tabs .section-container').height(heightOfTabContent + 75);
      } else {
        $('#product_tabs .section-container').height(170);
        setTimeout('Hadean.Product.tabs.updateProductTabs()', 200);
      }
    }
  };
  jQuery(function() {
    Hadean.Product.tabs.initialize();
  });
};
var Hadean = window.Hadean || { };
if (typeof Hadean.Cart == "undefined") {
    Hadean.Cart = {};
}
dd = null;
if (typeof Hadean.Cart.newForm == "undefined") {
  Hadean.Cart.newForm = {
    newFormId : '#new_cart_item',
    addToCart : true,

    initialize      : function() {
      jQuery('#submit_add_to_cart').click( function() {
          if (jQuery('#cart_item_variant_id').val() == '' ) { // Select to see if variant is selected in hidden field
            alert('Please click on a specific item to add.');
          } else
          if (Hadean.Cart.newForm.addToCart) {

            Hadean.Cart.newForm.addToCart = false;// ensure no double clicking
            jQuery(Hadean.Cart.newForm.newFormId).submit();

          }
        }
      )
      // This code is to change the color of the selected and non-selected variants
      jQuery('.variant_select').click( function() {

          jQuery('.variant_properties').each( function(index, obj) {
            jQuery(obj).removeClass('selected');
          });

          var propId = '#variant_properties_' + $(this).data("variant_id");
        $( propId ).addClass('selected');
          jQuery('#cart_item_variant_id').val($(this).data("variant_id"));
          jQuery(".variant_select").removeClass('selected_variant');
          jQuery(this).addClass('selected_variant');
          //jQuery('#submit_add_to_cart').removeClass('add-to-cart').addClass('ready-to-add-to-cart');
        }
      );
    }
  };
  jQuery(function() {
    Hadean.Cart.newForm.initialize();
  });
};



























$(function(){ 
  $(document).foundation();
  $('.carousel').carousel();
  $('#myCarousel').on('slid', function() {
      var to_slide = $('#myCarousel .carousel-inner .item.active').attr('id');
      $('.carousel-indicators').children().removeClass('active');
      $('.carousel-indicators [data-slide-to=' + to_slide + ']').addClass('active');
  });
  $('#MyProdctslider').on('slid', function() {
      var to_slide = $('#MyProdctslider .carousel-inner .item.active').attr('id');
      $('.product-indicators ul li .active').removeClass('active');
      $('.product-indicators [data-slide-to=' + to_slide + ']').addClass('active');
  });

  $('#MyDiscountslider').on('slid', function() {
      var to_slide = $('#MyDiscountslider .carousel-inner .item.active').attr('id');
      $('.product-indicators ul li .active').removeClass('active');
      $('.product-indicators [data-slide-to=' + to_slide + ']').addClass('active');
  });
  
  $('.my-img').click(function(){
    $('.my-img a').slideToggle();
    $('.login-div').slideToggle();
  });
  $('.slider1').bxSlider({
      slideWidth: 1640 ,
      minSlides: 1,
      maxSlides: 1,
      slideMargin: 0
    });
  $('.products_bigimage_slider').bxSlider({
      slideWidth: 1500,
      minSlides: 5,
      maxSlides: 10,
      slideMargin: 0
    });
  $('.products_smallimage_slider').bxSlider({
      slideWidth: 1500,
      minSlides: 7,
      maxSlides: 21,
      slideMargin: 0
    });
  $("#product_prototype_id").click (function(){
     jQuery.ajax( {
           type : "GET",
           url : '/admin/merchandise/products'+'/'+$("#product_prototype_id option:selected").first().val()+"/add_properties",
           data : { product_id : $(this).attr('data-product_id') },
           complete : function(json) {
             // open dialog with html
             Hadean.AdminMerchandiseProductForm.refreshProductForm(json);
            // STOP  WAIT INDICATOR...
           },
           dataType : 'json'
        });
  });

  $('body').prepend('<div id="fb-root"></div>');
  return $.ajax({
    url: "" + window.location.protocol + "//connect.facebook.net/en_US/all.js",
    dataType: 'script',
    cache: true
  });

  window.fbAsyncInit = function() {
    FB.init({
      appId: '',
      cookie: true
    });
    $('#sign_in').click(function(e) {
      e.preventDefault();
      return FB.login(function(response) {
        if (response.authResponse) {
          return window.location = '/auth/facebook/callback';
        }
      });
    });
    return $('#sign_out').click(function(e) {
      FB.getLoginStatus(function(response) {
        if (response.authResponse) {
          return FB.logout();
        }
      });
      return true;
    });
  };

  

});
